import { Injectable } from '@angular/core';
import { Formulaire } from './models/formulaire';

@Injectable({
  providedIn: 'root'
})
export class FormService {

private tab : Formulaire[] = [];

  constructor() { }

  addFormulaire(formulaire: Formulaire) {
    this.tab.push(formulaire);
  }

  getFormulaire() {
    return this.tab;
  }






}
